create table patients (
	id INT,
	patient_id VARCHAR(50),
	alive VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	dob DATE,
	admit DATE,
	dischared DATE,
	ward VARCHAR(3),
	primary_diagnosis VARCHAR(50),
	secondary_diagnosis VARCHAR(50),
	physician VARCHAR(1),
	blood_group VARCHAR(5),
	allergy VARCHAR(50),
	address VARCHAR(50),
	state VARCHAR(3),
	telephone VARCHAR(50)
);
